import React from 'react';


export default function Header (){
    return (
        <div className="App-header">
            <div className='header-item'>
                <h1>Breast Cancer SVM</h1>
            </div>
            <div className='header-item'>
                <div>How to Use</div>
            </div>
            <div className='header-item'>
                Download Graph
            </div>
        </div>
    )
    
}
